        <style>
        body {
            font-family: 'Open Sans Regular', sans-serif;
            font-size: 16px;
            font-weight: 100;
            text-align: center;
            padding-top: 3em;
        }

        h1, h2, h3, h4, h5 {
            font-family: 'Open Sans Condensed', sans-serif;
        }

        .error-logo {
            width: 100%;
        }

        .error-logo img {
            max-width: 50%;
            max-height: 12em;
        }

        .error-title {
            font-size: 4.5em;
            font-weight: lighter;
        }

        .error-title .title-inline-img {
            height: 1em;
        }

        .error-title .title-inline-img img {
            height: 1em;
        }

        .error-subtitle {
            font-size: 1.6em;
            font-weight: lighter;
        }

        .error-subtitle-action {
            font-size: 1.6em;
            font-weight: 600;
            margin-bottom: 3em;
        }

        .action {
            width: 12em;
            /*height: 3em;*/
            margin-left: auto;
            margin-right: auto;
            background: #eeeeee;
            border: 2px solid #cccccc;

            font-family: 'Open Sans Condensed', sans-serif;
            padding-top: 0.3em;
            padding-bottom: 0.3em;
            font-size: 1.6em;
            text-transform: uppercase;
            color: #333333;
            margin-bottom: 0.7em;
        }

        a {
            text-decoration: none;
        }

        .action:hover {
            color: white;
            background: #444444;
        }

        .action.action-dark {
            color: white;
            background: #444444;
        }

        .action.action-dark:hover {
            color: #333333;
            background: #eeeeee;
        }
        </style>
